         "created_time": "2021-03-19T06:10:35+0000",
         "message": "\ud83c\udf3a\ud83c\udf3a\ud83c\udf3a Qu\u00fd Th\u1ea7y, C\u00f4 gi\u00e1o v\u00e0 c\u00e1c b\u1ea1n sinh vi\u00ean th\u00e2n m\u1ebfn!!!!\n\nNh\u1eb1m n\u00e2ng cao h\u01a1n n\u1eefa ch\u1ea5t l\u01b0\u1ee3ng c\u1ee7a c\u00f4ng t\u00e1c d\u1ea1y v\u00e0 h\u1ecdc, th\u1eddi gian t\u1edbi Ph\u00e2n hi\u1ec7u d\u1ef1 ki\u1ebfn x\u00e2y d\u1ef1ng m\u1ed9t c\u0103n tin hi\u1ec7n \u0111\u1ea1i \u1edf v\u1ecb tr\u00ed nh\u00e0 xe c\u0169 b\u00ean Khu gi\u1ea3ng \u0111\u01b0\u1eddng (k\u1ebf b\u00ean C2). D\u01b0\u1edbi \u0111\u00e2y l\u00e0 thi\u1ebft k\u1ebf ph\u1ed1i c\u1ea3nh c\u1ee7a c\u0103n tin, r\u1ea5t mong nh\u1eadn \u0111\u01b0\u1ee3c \u00fd ki\u1ebfn \u0111\u00f3ng g\u00f3p c\u1ee7a qu\u00fd Th\u1ea7y, C\u00f4 gi\u00e1o v\u00e0 c\u00e1c b\u1ea1n sinh vi\u00ean \u0111\u1ec3 ho\u00e0n thi\u1ec7n thi\u1ebft k\u1ebf v\u00e0 s\u1edbm \u0111\u01b0a c\u0103n tin v\u00e0o s\u1eed d\u1ee5ng trong th\u1eddi gian s\u1edbm nh\u1ea5t. \nM\u1ecdi \u00fd ki\u1ebfn \u0111\u00f3ng g\u00f3p qu\u00fd Th\u1ea7y, C\u00f4 v\u00e0 c\u00e1c b\u1ea1n vui l\u00f2ng g\u1eedi email v\u1ec1 \u0111\u1ecba ch\u1ec9: phongctctsv\u0040utc2.eu.vn ho\u1eb7c comment tr\u1ef1c ti\u1ebfp d\u01b0\u1edbi b\u00e0i \u0111\u0103ng. Tr\u00e2n tr\u1ecdng c\u1ea3m \u01a1n./.",
