         "created_time": "2021-02-02T09:01:44+0000",
         "message": "[T\u01af V\u1ea4N H\u01af\u1edaNG NGHI\u1ec6P V\u00c0 H\u01af\u1edaNG D\u1eaaN CH\u1ebe T\u1ea0O ROBOT SUMO N\u0102M 2021]\n\nTrong chu\u1ed7i c\u00e1c ho\u1ea1t \u0111\u1ed9ng h\u1ed7 tr\u1ee3 c\u1ee7a cu\u1ed9c thi Robot Sumo n\u0103m 2021 do \u0110o\u00e0n Tr\u01b0\u1eddng \u0110\u1ea1i h\u1ecdc Giao th\u00f4ng V\u1eadn t\u1ea3i - Ph\u00e2n hi\u1ec7u t\u1ea1i Th\u00e0nh ph\u1ed1 H\u1ed3 Ch\u00ed Minh ph\u1ed1i h\u1ee3p Th\u1ecb \u0110o\u00e0n \u0110\u00f4ng Ho\u00e0. \u0110\u1ea1i di\u1ec7n Tr\u01b0\u1eddng \u0110\u1ea1i h\u1ecdc Giao th\u00f4ng V\u1eadn t\u1ea3i - Ph\u00e2n hi\u1ec7u t\u1ea1i TP. H\u1ed3 Ch\u00ed Minh, sinh vi\u00ean \u0110\u1eb7ng V\u0103n Long \u0111\u00e3 gi\u1edbi thi\u1ec7u cho t\u1eebng \u0111\u1ed9i thi v\u1ec1 c\u00e1c n\u1ed9i dung c\u01a1 b\u1ea3n li\u00ean quan \u0111\u1ebfn vi\u1ec7c ch\u1ebf t\u1ea1o Robot Sumo v\u00e0 h\u01b0\u1edbng d\u1eabn c\u00e1c b\u1ea1n h\u1ecdc sinh th\u1ef1c hi\u1ec7n \u0111\u1ec3 tham gia cu\u1ed9c thi.",
